// Own header
#include "modules/computer_vision/cnn.h"
#include <stdio.h>

// Include the image library -> used to alter the incoming image
#include "modules/computer_vision/lib/vision/image.h"

// Include the ABI library -> used to send messages to the ground station
#include "modules/core/abi.h"

// #include "mcu_periph/sys_time.h"

#ifndef CNN_FPS
#define CNN_FPS 0 ///< Default FPS (zero means run at camera fps)
#endif

// Define white color
uint8_t white[4] = {127, 255, 127, 255};

// Competition mode
bool competition_mode = false;

// Function
static struct image_t *cnn_func(struct image_t *img, uint8_t camera_id __attribute__((unused)))
{
  // Convert to grayscale, but also keep original for live feed
  struct image_t gray;
  image_create(&gray, img->w, img->h, IMAGE_GRAYSCALE);
  image_to_grayscale(img, &gray);

  // Convert image to tensor
  float tensor_output[1][3];
  float tensor_input[1][1][TENSOR_HEIGHT][TENSOR_WIDTH];
  convert_image_to_tensor(&gray, tensor_input);

  // Perform inference
  entry(tensor_input, tensor_output);

  // Softmax on the output
  float sum_exp = exp(tensor_output[0][0]) + exp(tensor_output[0][1]) + exp(tensor_output[0][2]);
  tensor_output[0][0] = exp(tensor_output[0][0]) / sum_exp;
  tensor_output[0][1] = exp(tensor_output[0][1]) / sum_exp;
  tensor_output[0][2] = exp(tensor_output[0][2]) / sum_exp;
  
  // Draw rectangles on the original image corresponding to the outputs
  if (!competition_mode) {
    int x_min_left = 10;
    int x_max_left = 10 + (int)(tensor_output[0][0] * 40);
    int y_min_left = 10;
    int y_max_left = 30;
    image_draw_rectangle(img, x_min_left, x_max_left, y_min_left, y_max_left, white);

    int x_min_forward = 10;
    int x_max_forward = 10 + (int)(tensor_output[0][1] * 40);
    int y_min_forward = 35;
    int y_max_forward = 55;
    image_draw_rectangle(img, x_min_forward, x_max_forward, y_min_forward, y_max_forward, white);

    int x_min_right = 10;
    int x_max_right = 10 + (int)(tensor_output[0][2] * 40);
    int y_min_rigth = 60;
    int y_max_right = 80;
    image_draw_rectangle(img, x_min_right, x_max_right, y_min_rigth, y_max_right, white);
  }

  // // Print outputs
  // printf(stderr, "Right: %f, Forward: %f, Left: %f\n", tensor_output[0][0], tensor_output[0][1], tensor_output[0][2]);

  // Send outputs
  AbiSendMsgCNN_CONTROL_INPUTS(CNN_CONTROL_INPUTS_ID, tensor_output[0][0], tensor_output[0][1], tensor_output[0][2]);

  return img;
}

void cnn_init(void)
{
  cv_add_to_device(&CNN_CAMERA, cnn_func, CNN_FPS, 0);
}

void convert_image_to_tensor(struct image_t *image, float tensor_input_1[1][1][TENSOR_HEIGHT][TENSOR_WIDTH]) {
    // Extract pixel values from the image buffer
    uint8_t *pixel_values = (uint8_t *)(image->buf);

    // The method below is not very efficient, as it first saves the entire image and then extracts
    // the downsampled region of interest. However, this is the easiest way to do it for now. 
    // This can and probably should be optimized in the future.
    // first store the image in a tensor
    float intermediate[1][1][520][240];
    for (int i = 0; i < 520; i++) {
        for (int j = 0; j < 240; j++) {
            intermediate[0][0][i][j] = (float)pixel_values[(i * image->w) + j] / 255.0f;
          }
        }

    // then extract the region of interest
    for (int i = 0; i < TENSOR_HEIGHT; i++) {
        for (int j = 0; j < TENSOR_WIDTH; j++) {
            int row_idx = i * (520 / TENSOR_HEIGHT);
            int col_idx = j * (120 / TENSOR_WIDTH) + 60;
            tensor_input_1[0][0][i][j] = (intermediate[0][0][row_idx][col_idx] - 0.3046516478061676) / 0.1654612421989441;
        }
    }
}

